import '../css/Post.css';
import React from 'react';

const Gallery = () => {
	let imageUrl = 'https://picsum.photos/540/320?grayscale&random=1	';
	let userLocation = 'Corperation Rd., Ntinda';
	let userName = 'needs_deeds';
	let donorName = 'Mugezigezi';
	return (
		<React.Fragment>
			{' '}
			<div className="card mt-5">
				<div className="card-header">
					<i className="bi bi-arrow-down-left-circle" />
					<span className="fst-italic mx-2">
						Request from {userName} of {userLocation} was fulfilled by {donorName}.
					</span>
				</div>
				<img src={imageUrl} className="card-img-top" alt="S/O to Lorem Picsum" />
			</div>
			<div className="card mt-5">
				<div className="card-header">
					<i className="bi bi-arrow-down-left-circle" />
					<span className="fst-italic mx-2">
						Donation from {userName} of {userLocation} was fulfilled by {donorName}.
					</span>
				</div>
				<img src={imageUrl} className="card-img-top" alt="S/O to Lorem Picsum" />
			</div>
		</React.Fragment>
	);
};

export default Gallery;
